import React from 'react'


let Timer = setInterval(function timer() {
    let this_date = new Date();
    let new_date = new Date() - this_date;
    let millis = Math.floor((this_date % 1000) / 100);

    let seconds = Math.floor(this_date / 1000) % 60;

    let minutes = Math.floor(this_date / 1000 / 60) % 60;

    let hours = Math.floor(this_date / 1000 / 60 / 60) % 24;

    return <div>{[hours, minutes, seconds].join(':') + "." + millis}</div>
}, 100);

export default Timer
